#trigger to set the reservation date as the current date
DELIMITER $$
CREATE TRIGGER set_reservation_date
BEFORE INSERT ON reserves
FOR EACH ROW
BEGIN
	SET new.reservation_date=CURDATE();
END$$

#trigger to set the borrowing date as the current date
DELIMITER $$
CREATE TRIGGER set_borrowing_date
BEFORE INSERT ON borrows
FOR EACH ROW
BEGIN
	SET new.borrowing_date=CURDATE();
END$$

#trigger to calculate the due return day
DELIMITER $$
CREATE TRIGGER set_due_return_date
BEFORE INSERT ON borrows
FOR EACH ROW
BEGIN
    SET new.due_return_date=ADDDATE(new.borrowing_date, 7);
END$$

#checking if a user has delayed the return of a book
DELIMITER $$
CREATE TRIGGER borrows_delay_in_returning
BEFORE INSERT ON borrows
FOR EACH ROW
BEGIN
	IF ( 
		SELECT COUNT(*) 
        FROM(
			SELECT DATEDIFF(due_return_date, CURDATE()) as date_difference
			FROM borrows
			WHERE username=new.username
            AND return_date IS NULL
            AND DATEDIFF(due_return_date, CURDATE()) <0
		) as subquery
    ) > 0
    THEN SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'The user has delayed returning a book.';
    END IF;
END$$

DELIMITER $$
CREATE TRIGGER reserves_delay_in_returning
BEFORE INSERT ON reserves
FOR EACH ROW
BEGIN
	IF ( 
		SELECT COUNT(*) 
        FROM(
			SELECT DATEDIFF(due_return_date, CURDATE()) as date_difference
			FROM borrows
			WHERE username=new.username
            AND return_date IS NULL
            AND DATEDIFF(due_return_date, CURDATE()) <0
		) as subquery
    ) > 0
    THEN SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'You have delayed returning a book.';
    END IF;
END$$

